webpackJsonp([0xb118c846b4c0],{7244:function(t,e){t.exports={data:{post:{html:"<p>That's what I get for going to bed early. The official count came out at midnight, and the CDU-FDP have fallen short of a majority by 70 votes. Of the 69 seats in the state parliament, they have 34 to 33 for SPD-Green. </p>\n<p>The 2 remaining seats belong the SSW, the Danish minority party exempt from the 5% clause. They won't join a coalition, but would tolerate a minority government. The SSW supports a Scandinavian model for economic and education policies, and are more likely to support a SPD government.</p>",fields:{title:"Schleswig-Holstein Counts the Votes",date:"21 Feb 2005",url:"https://papascott.de/2005-02-21-schleswigholstein-counts-the-votes/"}}},pathContext:{slug:"/2005-02-21-schleswigholstein-counts-the-votes/",prev:{fields:{title:"Five Questions",date:"21 Feb 2005",slug:"/2005-02-21-five-questions/"}},next:{fields:{title:"Night Shift",date:"23 Feb 2005",slug:"/2005-02-23-night-shift/"}}}}}});
